import React from 'react';
import './components.css';

const Hobbies = () => {
  return (
    <section id="hobbies">
      <h1>My Hobbies</h1>
      <p>Although I enjoy coding, I also have other hobbies as well. One of my main hobbies is collecting trading and collectable cards. I enjoy Pokemon cards and football cards. I have several high value Pokemon and Football cards that are worth in the hundreds.</p>
      <br></br>
    </section>
  );
};

export default Hobbies;
